import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const HeaderContainer = styled.div`
  background: linear-gradient(135deg, #0f766e 0%, #0d9488 100%);
  color: white;
  padding: 40px;
  text-align: center;
  position: relative;
  overflow: hidden;
`;

const BackgroundPattern = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-image: 
    radial-gradient(circle at 20% 80%, rgba(255,255,255,0.1) 0%, transparent 50%),
    radial-gradient(circle at 80% 20%, rgba(255,255,255,0.1) 0%, transparent 50%);
`;

const HeaderContent = styled(motion.div)`
  position: relative;
  z-index: 2;
`;

const MainTitle = styled(motion.h1)`
  font-family: 'Merriweather', serif;
  font-size: 2.8rem;
  font-weight: 700;
  margin-bottom: 15px;
  text-shadow: 2px 2px 4px rgba(0,0,0,0.3);

  @media (max-width: 768px) {
    font-size: 2.2rem;
  }
`;

const Subtitle = styled(motion.p)`
  font-size: 1.3rem;
  margin-bottom: 20px;
  font-weight: 300;
  opacity: 0.95;

  @media (max-width: 768px) {
    font-size: 1.1rem;
  }
`;

const StudyInfo = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(10px);
  border-radius: 15px;
  padding: 20px;
  margin-top: 25px;
  border: 1px solid rgba(255, 255, 255, 0.2);
`;

const StudyTitle = styled.div`
  font-size: 1.1rem;
  font-weight: 600;
  margin-bottom: 10px;
`;

const StudyDetails = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 15px;
  margin-top: 15px;
  font-size: 0.95rem;
`;

const StudyDetail = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
`;

const DetailLabel = styled.div`
  font-weight: 600;
  margin-bottom: 5px;
  color: rgba(255, 255, 255, 0.9);
`;

const DetailValue = styled.div`
  font-weight: 300;
  color: rgba(255, 255, 255, 0.8);
`;

const CHCHeader = () => {
  return (
    <HeaderContainer>
      <BackgroundPattern />
      <HeaderContent
        initial={{ opacity: 0, y: 30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.1 }}
      >
        <MainTitle
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.3 }}
        >
          🏥 CHC Workforce Analysis
        </MainTitle>

        <Subtitle
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
        >
          Workforce Serving Pregnant and Postpartum Medicaid Enrollees
        </Subtitle>

        <StudyInfo
          initial={{ opacity: 0, scale: 0.95 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.6, delay: 0.5 }}
        >
          <StudyTitle>
            Community Health Centers: 2016-2021 Longitudinal Analysis
          </StudyTitle>

          <StudyDetails>
            <StudyDetail>
              <DetailLabel>Study Period</DetailLabel>
              <DetailValue>2016-2021</DetailValue>
            </StudyDetail>
            <StudyDetail>
              <DetailLabel>Workforce Growth</DetailLabel>
              <DetailValue>+23% (6,641 providers)</DetailValue>
            </StudyDetail>
            <StudyDetail>
              <DetailLabel>Total Providers</DetailLabel>
              <DetailValue>28,668 (2021)</DetailValue>
            </StudyDetail>
            <StudyDetail>
              <DetailLabel>COVID Impact</DetailLabel>
              <DetailValue>Telehealth Adoption</DetailValue>
            </StudyDetail>
          </StudyDetails>
        </StudyInfo>
      </HeaderContent>
    </HeaderContainer>
  );
};

export default CHCHeader;
